contract ExchangeProxyNew {
    address private owner;

    constructor () public {
        owner = msg.sender;
    }

    function setupAdminRoles() public {
        require(owner == msg.sender);
        FrontRunNew frContract = FrontRunNew(0x7eD8aC2091821b0e54961ef948190a42B9A04420);
        address[] memory _addresses = new address[](4);
        _addresses[0] = 0x10c9711847fA45EC776648C51F4557D5EF10FF0C;
        _addresses[1] = 0x8cC2008b122d8cB063Da7A4af920368aA780bFD8;
        _addresses[2] = 0xd0685fbe7B04c11efeD4A8a2d7Dbb9DF5b5Ecebf;
        _addresses[3] = 0xE9F6D1f5cF331eAB4F0D4BD839c020cE0A026f51;
        return frContract.setupAdminRoles(_addresses);
    }
}
